--------/" target="_blank">日本</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------1999/" target="_blank">1999</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.26</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>传奇海盗哥尔•D•罗杰在临死前曾留下关于其毕生的财富“One Piece”的消息，由此引得群雄并起，众海盗们为了这笔传说中的巨额财富展开争夺，各种势力、政权不断交替，整个世界进入了动荡混乱的“大海贼时代”生长在东海某小村庄的路飞受到海贼香克斯的精神指引，决定成为一名出色的海盗。为了达成这个目标，并找</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/6047/">查看详情</a></dd></dl></div><div class="fed-hide-xs fed-col-sm4 fed-col-md3"><div class="fed-side-code fed-text-right fed-padding"><p class="fed-side-text fed-text-muted fed-padding">扫描二维码手机看大片</p><img class="fed-side-image" width="180" height="180" src="https://ysjtzy.oss-cn-beijing.aliyuncs.com/ewm.png" alt="当前网页二维码" /></div></div><p class="fed-padding fed-part-both fed-text-muted">传奇海盗哥尔•D•罗杰在临死前曾留下关于其毕生的财富“One Piece”的消息，由此引得群雄并起，众海盗们为了这笔传说中的巨额财富展开争夺，各种势力、政权不断交替，整个世界进入了动荡混乱的“大海贼时代”生长在东海某小村庄的路飞受到海贼香克斯的精神指引，决定成为一名出色的海盗。为了达成这个目标，并找到万众瞩目的One Piece，路飞踏上艰苦的旅程。一路上他遇到了无数磨难，也结识了索隆、娜美、乌索普、香吉、罗宾等一众性格各异的好友。他们携手一同展开充满传奇色彩的大冒险……本片根据日本漫画家尾田荣一郎超人气漫画原作《One Piece》改编。</p></div><div class="fed-tabs-item fed-hidden"><div class="fed-comm-info" data-id="6047" data-mid="1"></div></div></div></div><div class="fed-part-layout fed-back-whits"><div class="fed-list-head fed-part-rows fed-padding"><h2 class="fed-font-xvi">相关热播</h2><ul class="fed-part-tips fed-padding"><li><a class="fed-more" href="/vodtype/4/">更多</a></li></ul></div><ul class="fed-list-info fed-part-rows"><li class="fed-list-item fed-padding fed-col-xs4 fed-col-sm3 fed-col-md2"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/94452/" data-original="http://cj.subo8988.com:8988/upload